Ingende Territory covers 17,328 km² and is divided into three administrative divisions or "sectors":
Bokatola, with 6 groupings (groupements) and 118 villages;
Duali, with 5 groupings (groupements) and 143 villages;
Eungu, with 4 groupings (groupements) and 94 villages.

Kinshasa is home to the Government of the Democratic Republic of the Congo including: 

the Palais de la Nation, home of the President, in Gombe;
the Palais du Peuple, meeting place of both houses of Parliament, Senate and National Assembly, in Lingwala;
the Palais de Justice, in Gombe;
the Cité de l’OUA, built for the Organization of African Unity in the 1970s and now serving government functions, in Ngaliema.The Central Bank of the Congo has its headquarters on Boulevard Colonel Tshatshi, across the street from the Mausoleum of Laurent Kabila and the presidential palace.

